    <div class="container-fluid wrap">
      <div class="flex justify-between items-center">
        <div class="tag">Visão Geral</div>
        <Share/>
      </div>
      
      <h2>{{capital.nome}}</h2>
      <div class="flex flex-wrap mt-12">
        <div class="w-full md:w-6/12 md:pr-12">
          <div class="dados-capital">
            <div :class="escalaGlobal(capital.geral)">
              <p class="numero">{{capital.geral}}</p>
              <p class="legenda">nível<br/>{{escalaGlobal(capital.geral)}}</p>
            </div>
            <div class="bg-cinzaClaro">
              <p class="numero">{{Object.values(capitais).sort((a,b)=>{return b.geral-a.geral}).map(x=>x.slug).indexOf(capital_slug)+1}}ª</p>
              <p class="legenda">posição no ranking</p>
            </div>
            <div v-if="bases" class="bg-cinzaClaro">
              <p class="numero estrela">{{bases}}</p>
              <p class="legenda">bases estreladas</p>
            </div>
          </div>

          <div class="mx-auto mt-6">
            <svg width="auto" height="280px"><use :class="escalaGlobal(capital.geral)" :xlink:href="`#c${capital.key}`"></use></svg>
          </div>

          <!-- legenda -->
          <div class="grid justify-stretch gap-2 grid-cols-5 t11 font-black uppercase mt-8">
            <div class="text-center">
              <div class="bg-rosa p-1 mb-1 rounded">opaco</div>
              <div>0 - 20</div>
            </div>
            <div class="text-center">
              <div class="bg-rosaClaro p-1 mb-1 rounded">baixo</div>
              <div>1 - 40</div>
            </div>
            <div class="text-center">
              <div class="bg-bege p-1 mb-1 rounded">medio</div>
              <div>41 - 60</div>
            </div>
            <div class="text-center">
              <div class="bg-verdeClaro p-1 mb-1 rounded">bom</div>
              <div>61 - 80</div>
            </div>
            <div class="text-center">
              <div class="bg-verde p-1 mb-1 rounded">alto</div>
              <div>81 - 100</div>
            </div>
          </div>
        </div>

        <div class="w-full md:w-6/12 md:pl-12">
          <table class="tabela tabela-mapa">
            <thead>
              <tr>
                <th class="capital">Município</th>
                <th>Pontuação</th>
                <th>Nível</th>
              </tr>
            </thead>
            <tbody>
              <tr v-for="d in conjuntos">
                <td class="capital icon" :data-dimensao="d.label"><span>{{d.label}}</span></td>
                <td class="pontuacao">{{Math.round(capital.notas[d.key])}}</td>
                <td class="nivel"><span class="label" :class="escalaGlobal(capital.notas[d.key])">{{escalaGlobal(capital.notas[d.key])}}</span></td>
              </tr>
            </tbody>
          </table>

          <a @click="scrollto('avaliacao')" class="btn-arrow mt-4">Veja a avaliação detalhada</a>
        </div>
      </div>
    </div>
  </section>

  <div class="capital-banner">
    <div class="container-fluid wrap text-center">
      <h4 class="text-branco font-semibold mb-2">Explore os resultados</h4>
      <p class="text-branco t18 max-w-lg mx-auto">Em cada dimensão temática, analisamos diferentes conjuntos de dados a partir de uma série de indicadores. Você pode conferir o desempenho desta capital em cada um deles a seguir.</p>
      <a @click="scrollto('avaliacao')" class="btn-arrow">Veja a avaliação detalhada</a>
    </div>
  </div>

